window.bookSummaryJSON = "<p><b>She is scarred.</b></p> <p>When I stormed into her life, it was supposed to be temporary.</p> <p>Anais was supposed to be like the rest.</p> <p>Then I became addicted.</p> <p>My past caught up with me and she walked out before I could make her mine.</p> <p>Tragedy strikes and I have no choice but to bring her back into my world.</p> <p>In order to protect her, I convince her to wear my ring.</p> <p>But I fear even I can’t protect her from the turmoil we’re about to face.</p> <p>Scarred Empire<i> is the second in an enemies-to-lovers billionaire trilogy. Themes in this dark and sexy series may not be suitable for all listeners.</i></p>"; 
